webpackJsonp([0x7a0a07915714],{416:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Концентрированный подъем на бицепс является лучшим упражнением, для придания более выпуклой и рельефной формы середине бицепса. Особенность данного упражнения в том, что в нем задействована большая амплитуда движения во время подъема гантели. Вторым преимуществом является то, что в верхней точке достигается сильнейшее пиковое сокращение бицепса, которое мы можем зафиксировать во времени.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Сядьте на край скамьи, расставив ноги так, чтобы руки свободно могли выполнять подъем гантели.</li>\n<li>Исходное положение: Правой рукой возьмите гантель нейтральным хватом, упираясь локтем в верхнюю область бедра. Ладони должны смотреть от Вас, а руки выпрямлены.</li>\n<li>На выдохе – сделайте подъем гантели на бицепс, работая исключительно предплечьем. Выполняйте сгибание до тех пор, пока бицепс полностью не сократиться, а снаряд не будет у Ваших плеч. Задержитесь в верхней точке для максимальной эффективности.</li>\n<li>На вдохе – плавно опустите гантель, вернувшись в исходное положение.</li>\n<li>Выполните необходимое количество сгибаний для обеих рук.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/quKVcoTV8T0" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/podjem-gantelei-na-biceps-stoya-hvatom-molot",efficiency:"7",title:"Подъем гантелей стоя хватом молот",image:"https://iq-body.ru/uploads/ra/755x567/training/original/0a86dcc7dc4eaa775f2ae0ec3f4182749d7cc7bf.jpg",image_2:"",image_3:"",image_4:"",filterby:"biceps",date:"April 12, 2017",injury:"3",bodypart:"Бицепс",filtertype:"isolated",type:"Изолирующее",filterinventory:"dumbbells",inventory:"Гантели",filterplace:null}}},pathContext:{}}}});
